INSERT INTO "Clinics" ("id", "name", "address", "description", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(1, 'Bệnh viện Hữu nghị Việt Đức', 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', NULL, '<p><strong>Từ nay, người bệnh có thể đặt lịch tại Khu khám bệnh theo yêu cầu, Bệnh viện Hữu nghị Việt Đức thông qua hệ thống đặt khám BookingCare.</strong></p><p>Được lựa chọn các giáo sư, tiến sĩ, bác sĩ chuyên khoa giàu kinh nghiệmHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)Giảm thời gian chờ đợi khi làm thủ tục khám và ưu tiên khám trướcNhận được hướng dẫn chi tiết sau khi đặt lịch</p>', '**Từ nay, người bệnh có thể đặt lịch tại Khu khám bệnh theo yêu cầu, Bệnh viện Hữu nghị Việt Đức thông qua hệ thống đặt khám BookingCare.**Được lựa chọn các giáo sư, tiến sĩ, bác sĩ chuyên khoa giàu kinh nghiệmHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch) Giảm thời gian chờ đợi khi làm thủ tục khám và ưu tiên khám trướcNhận được hướng dẫn chi tiết sau khi đặt lịch', 'data:image/jpeg;base64,', '2021-11-24 17:27:37', '2021-11-24 17:27:37');
INSERT INTO "Clinics" ("id", "name", "address", "description", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(2, 'Bệnh viện Chợ Rẫy', '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', NULL, '<p>Hàng nghìn người bệnh đến khám tại Bệnh viện Chợ Rẫy mỗi ngày. Nhằm nâng cao chất lượng dịch vụ và hỗ trợ người bệnh tốt hơn, Bệnh viện Chợ Rẫy triển khai đặt khám online thông qua Nền tảng Đặt khám BookingCare.</p><p>Để giảm thời gian chờ đợi và nhận được hướng dẫn đi khám tại Bệnh viện Chợ Rẫy, người bệnh vui lòng:</p><p>Chọn chuyên khoa phù hợp cần đi khámChọn thời gian đặt khámĐặt hẹn online trước khi đến khám.</p>', 'Hàng nghìn người bệnh đến khám tại Bệnh viện Chợ Rẫy mỗi ngày. Nhằm nâng cao chất lượng dịch vụ và hỗ trợ người bệnh tốt hơn, Bệnh viện Chợ Rẫy triển khai đặt khám online thông qua Nền tảng Đặt khám BookingCare. Để giảm thời gian chờ đợi và nhận được hướng dẫn đi khám tại Bệnh viện Chợ Rẫy, người bệnh vui lòng:Chọn chuyên khoa phù hợp cần đi khámChọn thời gian đặt khámĐặt hẹn online trước khi đến khám. ', 'data:image/jpeg;base64,', '2021-11-24 17:29:50', '2021-11-24 17:29:50');
