(3, 'Phòng khám Bệnh viện Đại học Y Dược 1', '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', NULL, '<p>Từ nay, người bệnh có thể đặt khámPhòng khám Bệnh viện Đại học Y Dược 1 thông qua hệ thống đặt khám BookingCare.</p><p>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệmHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)Giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khámNhận được hướng dẫn đi khám chi tiết sau khi đặt lịch</p>', 'Từ nay, người bệnh có thể đặt khámPhòng khám Bệnh viện Đại học Y Dược 1 thông qua hệ thống đặt khám BookingCare.Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệmHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)Giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khámNhận được hướng dẫn đi khám chi tiết sau khi đặt lịch', 'data:image/jpeg;base64,', '2021-11-24 17:31:03', '2021-11-24 17:31:03');
