(4, 'Bệnh viện K - Cơ sở Phan Chu Trinh', '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', NULL, '<p>Từ nay, người bệnh có thể đặt khám Bệnh viện K cơ sở Phan Chu Trinh thông qua hệ thống đặt khám BookingCare.</p><p>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệmĐặt lịch lấy số trước theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khámHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)Nhận được hướng dẫn đi khám chi tiết sau khi đặt lịch</p>', 'Từ nay, người bệnh có thể đặt khám Bệnh viện K cơ sở Phan Chu Trinh thông qua hệ thống đặt khám BookingCare.Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệmĐặt lịch lấy số trước theo giờ hẹn, giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khámHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch) Nhận được hướng dẫn đi khám chi tiết sau khi đặt lịch', 'data:image/jpeg;base64,', '2021-11-24 17:32:25', '2021-11-24 17:32:25');
