INSERT INTO "Markdowns" ("id", "contentHTML", "contentMarkdown", "description", "doctorId", "specialityId", "clinicId", "createdAt", "updatedAt") VALUES
(1, '<p>Giáo sư, Tiến sĩ, Bác sĩ Đào Văn LongGiáo sư, Tiến sĩ, Bác sĩ chuyên ngành Tiêu hóa - Gan mậtNguyên Giám đốc bệnh viện Đại Học Y Hà NộiNguyên Tổng thư ký hội khoa học tiêu hóa Việt NamNguyên Trưởng khoa tiêu hóa Bệnh viện Bạch MaiNguyên Giám đốc Trung tâm Nội soi Bệnh viện Đại học Y Hà NộiTốt nghiệp Đại học Y Hà Nội (1983)Tốt nghiệp Bác sĩ Nội trú trường Đại học Y Hà Nội (1986)Tốt nghiệp tiến sĩ Y khoa (1993)Bác sĩ không thăm khám ban đầu, chỉ đọc kết quảLưu ý: Quy trình sau đây áp dụng khi đi khám chữa bệnh với Giáo sư, Tiến sĩ Đào Văn Long</p><p>Tại Phòng khám Đa khoa Hoàng Long - Tầng 10, Tháp VCCI, Số 9 Đào Duy Anh, Đống Đa, Hà Nội</p><p>Quy trình đi khám bệnh Tiêu hóa với Giáo sư Đào Văn LongBước 1: Bác sĩ chuyên khoa Nội khám và kiểm tra tình trạng chung của người bệnhBước 2: Bác sĩ chuyên khoa Nội chỉ định chụp chiếu, xét nghiệm, nội soi (nếu cần)Bước 3: Thực hiện các xét nghiệm, chụp chiếu, nội soi theo chỉ định (nếu có)Bước 4: Ngưới bệnh gặp Giáo sư Đào Văn Long để đọc kết quả và phương án điều trịGhi chú: Bệnh nhân chỉ gặp Giáo sư Đào Văn Long ở Bước 4 (sau khi đã có kết quả xét nghiệm, chụp chiếu, nội soi)Bác sĩ chuyên khoa nội thực hiện khám và kiểm tra tình trạng chung cho người bệnh</p><p>Bác sĩ Chuyên khoa II Phạm Thị Lan Hương</p><p>Tốt nghiệp đại học Y khoa Hà Nội (1984)Nguyên trưởng khoa tiêu hóa Bệnh Viện ELịch khám bác sĩ Phạm Thị Lan Hương</p><p>Thứ 2 - Thứ 7 hàng tuầnSáng: 7h30 - 11h00Chiều: 13h30 - 16h00Giáo sư điều trị các bệnh lý tiêu hóaChẩn đoán, điều trị các bệnh lý Tiêu hóa</p><p>Giáo sư nhận điều trị các bệnh lý khó về Tiêu hóa, hậu môn, trực tràng, gan mật.Chẩn đoán và điều trị các bệnh về dạ dày, tá tràngChẩn đoán và điều trị các bệnh về đại, trực tràngPolyp dạ dày – tá tràng, đại tràngDị vật đường tiêu hóaChẩn đoán, điều trị u dưới niêm mạc dạ dày – tá tràng, đại tràngChẩn đoán, điều trị ung thư sớm đường tiêu hóaLấy sinh thiếtĐau dạ dàyChảy máu dạ dàyĐau thượng vịViêm dạ dàyLoét dạ dày tá tràngNhiễm Helicobacter pylori dạ dà