(2, '<p><strong>Bác sĩ chuyên khoa II Trần Thị Hoài Hương</strong></p><p>Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP. HCM</p><p>Bác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu</p><p><strong>Quá trình công tác</strong></p><ul><li><p>Trưởng khoa Dinh Dưỡng, Bệnh viện Da Liễu TP.HCM</p></li><li><p>Nguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TP.HCM</p></li><li><p>Hiện là Bác sĩ Da liễu, Phòng khám Da liễu Táo Đỏ</p></li><li><p>Bác sĩ chuyên khoa da liễu, thẩm mỹ da Bệnh Viện Da Liễu TP.HCM</p></li></ul><p><strong>Quá trình đào tạo</strong></p><p>Tốt nghiệp Bác sĩ Chuyên khoa II, chuyên ngành Da liễu, Đại học Y dược TP.HCMTốt nghiệp Bác sĩ Chuyên khoa I, chuyên ngành Da liễu, Đại học Y dược TP.HCMTốt nghiệp Bác sĩ Đa khoa, Đại học Y dược TP.HCMTham gia lớp Sơ bộ DInh dưỡng, Đại học Y khoa Phạm Ngọc ThạchThành viên các Hội khoa học, tổ chức chuyên mônHội viên chi hội Da Liễu Hồ Chí MinhHội viên Hội Da Liễu Việt NamKhám và điều trịBác sĩ khám và điều trị:</p><p>Mụn trứng cá: mụn viêm, bọc, nang, mụn đầu trắng, đâu đenNám, sạm da: nám, sạm da mặtRụng tóc, da dầu: mụn trứng cá, sẹo lồi, sẹo thâm, sẹo mụnMề đay: tóc gàu, vảy, rụng tóc từng phần, lan tỏaViêm da cơ địa: mảng da đỏ, ngứa nhiều, từng cơnViêm da dị ứng: mẩn đỏ da, ngứa, lan tỏaThủy đậu: mụn nước, ngứa, kèm sốt nhẹ, mệt mỏiZona: mang mụn nước, 1 bên người, đau nhứcDa nhờn, lỗ chân lông toVảy nến: mảng đổ da, tróc vảy, có thể toàn thânGhẻ ngứa: ngứa về đêm, vùng nếp, kẽ ngón tay, ngón chânRạn da: da đùi, da rạn teo, bụng, nếp bẹn, nách, lưngLão hóa da: da đổi màu, nhão, xệ, nến nhăn, sầnDa đồi mồi: đốm nâuPemphigus: bóng nước thân mình, niêm mạcLupus ban đỏ: hồng ban cánh bướm mặt, đau nhức mỏi cơ xương khớpXơ cứng bì: da cứng, không đều màuNấm da: da đỏ quằn quện, các vùng da, tóc, nếp daViêm da tiếp xúc: da đỏ, rát, nhạy cảm, tiếp xúc kiến ba khoangViêm da do nhiễm Corticoid, nhạy cảm: da đỏ, giãn mạch, mãng, nhạy cảm, nôi mụnNấm móngCác bệnh lý da khác và bệnh lây qua đường 