INSERT INTO "Specialities" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(2, 'Cơ xương khớp', '<h2><strong>Cơ Xương Khớp</strong></h2><p>Bác sĩ Cơ Xương Khớp giỏiDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:</p><p>Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệmCác giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Bệnh Cơ Xương KhớpGoutThoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổViêm khớp dạng thấp, Viêm đa khớp, Viêm gânTràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vaiLoãng xương, đau nhức xươngViêm xương, gai xươngViêm cơ, Teo cơ, chứng đau mỏi cơYếu cơ, Loạn dưỡng cơCác chấn thương về cơ, xương, khớp...</p>', '## **Cơ Xương Khớp**Bác sĩ Cơ Xương Khớp giỏiDanh sách các bác sĩ uy tín đầu ngành Cơ Xương Khớp tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, nhiều kinh nghiệmCác giáo sư, phó giáo sư đang trực tiếp nghiên cứu và giảng dạy tại Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu Khoa Cơ Xương Khớp - Bệnh viện Bạch Mai, Bệnh viện Hữu nghị Việt Đức,Bệnh Viện E.Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Cơ Xương Khớp, Hội Thấp khớp học,...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Bệnh Cơ Xương KhớpGoutThoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổViêm khớp dạng thấp, Viêm đa khớp, Viêm gânTràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vaiLoãng xương, đau nhức xươngViêm xương, gai xươngViêm cơ, Teo cơ, chứng đau mỏi cơYếu cơ, Loạn dưỡng cơCác chấn thương về cơ, xương, khớp...', 'data:image/jpeg;base64,', '2021-11-23 13:01:17', '2021-11-23 13:01:17');
INSERT INTO "Specialities" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(3, 'Thần kinh', '<p>Thần kinhBác sĩ Thần kinh giỏiDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:</p><p>Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.Khám bệnh chuyên khoa Thần kinhBại Não<br>Đau đầu, chóng mặt, buồn nôn<br>Bệnh Pakison, bệnh tiền đình<br>Bị co cơ, căng dây thần kinh<br>Động kinh, có những cơn vãng ý thức<br>Bị tê bì nửa mặt, chèn dây thần kinhBồn chồn, lo lắng, hồi hộp, chân tay run<br>Có dấu hiệu tăng động<br>Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi<br>Chấn thương đầu, dây thần kinh...</p>', 'Thần kinhBác sĩ Thần kinh giỏiDanh sách các giáo sư, bác sĩ chuyên khoa Thần kinh giỏi:Các giáo sư, bác sĩ uy tín đầu ngành chuyên khoa Thần kinh đã và đang công tác tại các bệnh viện lớn như: Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh viện 108, Bệnh viện Đại học Y Hà Nội, Bệnh viện 103.Là thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hội Thần kinh Việt Nam, Hội Phẫu thuật Thần kinh...Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp.Khám bệnh chuyên khoa Thần kinhBại Não   Đau đầu, chóng mặt, buồn nôn   Bệnh Pakison, bệnh tiền đình   Bị co cơ, căng dây thần kinh       Động kinh, có những cơn vãng ý thức   Bị tê bì nửa mặt, chèn dây thần kinhBồn chồn, lo lắng, hồi hộp, chân tay run   Có dấu hiệu tăng động    Co rút cổ, đau đầu với mặt, chân tay, vã mồ hôi   Chấn thương đầu, dây thần kinh...', 'data:image/jpeg;base64,', '2021-11-23 13:03:27', '2021-11-23 13:03:27');
INSERT INTO "Specialities" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(4, 'Tiêu hóa', '<h2>Tiêu hóa</h2><p>Bác sĩ Chuyên khoa Tiêu hóaDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:</p><p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà NộiCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...Tư vấn, khám và điều trị các Bệnh Tiêu hóa</p><p>Ăn uống kém, không ngonRối loạn tiêu hóa, táo bón, trĩNhiễm vi khuẩn HP (Helicobacter pylori)Nội soi dạ dày, đại tràng, tiêu hóaBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơiCo thắt thực quản, Hội chứng ruột kích thíchĐau bụng, dạ dày, đại tràng, thượng vịViêm đại tràng, dạ dày, tá tràngUng thư dạ dày, U nang tuyến tụyBệnh lý về gan, mật...</p>', 'Tiêu hóa---Bác sĩ Chuyên khoa Tiêu hóaDanh sách các bác sĩ Tiêu hóa uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà NộiCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...Tư vấn, khám và điều trị các Bệnh Tiêu hóaĂn uống kém, không ngonRối loạn tiêu hóa, táo bón, trĩNhiễm vi khuẩn HP (Helicobacter pylori)Nội soi dạ dày, đại tràng, tiêu hóaBuồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơiCo thắt thực quản, Hội chứng ruột kích thíchĐau bụng, dạ dày, đại tràng, thượng vịViêm đại tràng, dạ dày, tá tràngUng thư dạ dày, U nang tuyến tụyBệnh lý về gan, mật...', 'data:image/jpeg;base64,', '2021-11-23 13:05:34', '2021-11-23 13:05:34');
INSERT INTO "Specialities" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(5, 'Tim mạch ', '<h2>Tim mạch</h2><p>Bác sĩ tim mạch giỏiDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</p><p>Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà NộiLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt NamĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Khám tư vấn tim mạch</p><p>Khó thở, Đau ngực, đau timTăng huyết áp, hạ huyết ápRối loạn mỡ máu, cao huyết áp, chóng mặtBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủCảm giác hồi hộp, tim đập nhanh<br>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến<br>Đã đặt stent tim, nong động mạch vànhGiãn tĩnh mạch chân<br>...</p>', 'Tim mạch---Bác sĩ tim mạch giỏiDanh dách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:Các chuyên gia được đào tạo bài bản về chuyên ngành Tim mạch tại các trường đại học trong nước và quốc tế.Các giáo sư, phó giáo sư nghiên cứu và giảng dạy tại Đại học Y Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Viện Tim Mạch Quốc Gia, Bệnh viện Bạch Mai, Bệnh viện Việt Đức, Bệnh Viện E, Bệnh Viện Tim Hà NộiLà thành viên hoặc lãnh đạo các tổ chức chuyên môn như: Hiệp hội Tim Mạch Việt NamĐạt danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Khám tư vấn tim mạchKhó thở, Đau ngực, đau timTăng huyết áp, hạ huyết ápRối loạn mỡ máu, cao huyết áp, chóng mặtBệnh van tim (Hẹp hở van tim), Hẹp động mạch chủCảm giác hồi hộp, tim đập nhanh   Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến   Đã đặt stent tim, nong động mạch vànhGiãn tĩnh mạch chân   ...', 'data:image/jpeg;base64,', '2021-11-23 13:06:32', '2021-11-23 13:06:32');
INSERT INTO "Specialities" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(6, 'Y học cổ truyền', '<h1><strong>Y học Cổ truyền</strong></h1><p>Bác sĩ Y học Cổ truyền giỏiDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyềnCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..Tư vấn, khám và điều trị các vấn đề:</p><p>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</p>', '# **Y học Cổ truyền**Bác sĩ Y học Cổ truyền giỏiDanh sách các bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyềnCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..Tư vấn, khám và điều trị các vấn đề:Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', 'data:image/jpeg;base64,', '2021-11-23 13:07:32', '2021-11-23 13:07:32');
INSERT INTO "Specialities" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(7, 'Tai Mũi Họng', '<h2>Tai Mũi Họng</h2><p>Bác sĩ Chuyên khoa Tai Mũi HọngDanh sách các bác sĩ uy tín đầu ngành tại Việt Nam:</p><p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà NộiCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...Các bệnh Tai Mũi Họng</p><p>Ù tai, đau tai, chảy máu taiThủng màng nhĩ, điếc đột ngộtViêm tai giữaAmidan, V.AViêm xoangNghẹt mũiHay bị chảy máu camĐau cổ họng, khó nuốtHo kéo dàiNgủ ngáy...</p>', 'Tai Mũi Họng---Bác sĩ Chuyên khoa Tai Mũi HọngDanh sách các bác sĩ uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tai Mũi Họng tại Hà NộiCác giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà NộiCác bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Tai Mũi Họng Trung ương, Bệnh viện Quân Y 108...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ cao cấp,...Các bệnh Tai Mũi HọngÙ tai, đau tai, chảy máu taiThủng màng nhĩ, điếc đột ngộtViêm tai giữaAmidan, V.AViêm xoangNghẹt mũiHay bị chảy máu camĐau cổ họng, khó nuốtHo kéo dàiNgủ ngáy...', 'data:image/jpeg;base64,', '2021-11-23 13:10:10', '2021-11-23 13:10:10');
INSERT INTO "Specialities" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(8, 'Cột sống', '<h2>Cột sống</h2><p>Bác sĩ Chuyên khoa Cột sốngDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.</p><p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà NộiCác giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Bệnh Thần kinh - Cột sống</p><p>Đau cột sống, đau thắt lưngChấn thương cột sốngCột sống bị đau, sưng, cong, vẹoĐau mỏi cổ vai gáy, bả vaiĐau tê mông xuống chânPhồng đĩa đệmTê bì tay chânThóa hóa đốt sốngThoái hóa L4, L5Thoát vị đĩa đệmVôi hóa cột sốngXẹp cột sống...</p>', 'Cột sống---Bác sĩ Chuyên khoa Cột sốngDanh sách các bác sĩ Cột sống uy tín đầu ngành tại Việt Nam.Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Thần kinh - Cột sống - Xương khớp tại Hà NộiCác giáo sư, tiến sĩ, bác sĩ là giảng viên Đại học Y khoa Hà Nội, Học viện Quân Y.Các bác sĩ đã, đang công tác tại chuyên Khoa Thần Kinh, Cột sống, Xương Khớp - Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Trung ương Quân đội 108, Bệnh viện 103...Được nhà nước công nhận các danh hiệu Thầy thuốc Nhân dân, Thầy thuốc Ưu tú, Bác sĩ Cao cấp,...Bệnh Thần kinh - Cột sốngĐau cột sống, đau thắt lưngChấn thương cột sốngCột sống bị đau, sưng, cong, vẹoĐau mỏi cổ vai gáy, bả vaiĐau tê mông xuống chânPhồng đĩa đệmTê bì tay chânThóa hóa đốt sốngThoái hóa L4, L5Thoát vị đĩa đệmVôi hóa cột sốngXẹp cột sống...', 'data:image/jpeg;base64,', '2021-11-23 13:11:36', '2021-11-23 13:11:36');
INSERT INTO "Specialities" ("id", "name", "descriptionHTML", "descriptionMarkdown", "image", "createdAt", "updatedAt") VALUES
(9, 'Châm cứu', '<h2>Châm cứu</h2><p>Bác sĩ Châm cứu giỏi</p><p>Bác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:</p><p>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyềnCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..Tư vấn, khám và điều trị các vấn đề:</p><p>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</p>', 'Châm cứu---Bác sĩ Châm cứu giỏiBác sĩ Y học Cổ truyền uy tín đầu ngành tại Việt Nam:Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên khoa Y học Cổ truyềnCác bác sĩ đã, đang công tác tại chuyên Khoa Y học Cổ truyền - Bệnh viện Y học Cổ truyền Trung ương, Bệnh viện Bạch Mai, Thanh Nhàn..Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,..Tư vấn, khám và điều trị các vấn đề:Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', 'data:image/jpeg;base64,', '2021-11-23 13:12:53', '2021-11-23 13:12:53');
